    function packBeatmap(data) {
        const keys = {
            "[General]": [
                "AudioFilename",
                "AudioLeadIn",
                "PreviewTime",
                "Countdown",
                "SampleSet",
                "StackLeniency",
                "Mode",
                "LetterboxInBreaks",
                "UseSkinSprites",
                "OverlayPosition",
                "SkinPreference",
                "EpilepsyWarning",
                "CountdownOffset",
                "SpecialStyle",
                "WidescreenStoryboard",
                "SamplesMatchPlaybackRate",
            ],
            "[Editor]": [
                "Bookmarks",
                "DistanceSpacing",
                "BeatDivisor",
                "GridSize",
                "TimelineZoom",
            ],
            "[Metadata]": [
                "Title",
                "TitleUnicode",
                "Artist",
                "ArtistUnicode",
                "Creator",
                "Version",
                "Source",
                "Tags",
                "BeatmapID",
                "BeatmapSetID",
            ],
            "[Difficulty]": [
                "HPDrainRate",
                "CircleSize",
                "OverallDifficulty",
                "ApproachRate",
                "SliderMultiplier",
                "SliderTickRate",
            ],
            "[Colours]": [
                "Combo1 ",
                "Combo2 ",
                "Combo3 ",
                "Combo4 ",
                "Combo5 ",
                "Combo6 ",
                "Combo7 ",
                "Combo8 ",
                "SliderTrackOverride ",
                "SliderBorder ",
            ],
        };
        const defaults = {
            "[General]": [
                "",
                "0",
                "-1",
                "1",
                "Normal",
                "0.7",
                "0",
                "0",
                "0",
                "NoChange",
                "",
                "0",
                "0",
                "0",
                "0",
                "0",
            ],
            "[Editor]": ["", "1", "4", "64", "3"],
            "[Colours]": [
                "255,142,165",
                "255,169,187",
                "",
                "",
                "",
                "",
                "",
                "",
                "16,16,16",
                "192,192,192",
            ],
        };
        const beatmap = {};
        Object.keys(defaults).forEach((key) => {
            beatmap[key] = {};
            for (var i = 0; i < defaults[key].length; i++) {
                beatmap[key][keys[key][i]] = defaults[key][i];
            }
        });
        Object.keys(data).forEach((key) => {
            if (key in keys) {
                if (!(key in beatmap)) beatmap[key] = {};
                data[key]
                    .map((e) => e.replaceAll("\r", ""))
                    .forEach((e) => {
                        if (e)
                            beatmap[key][e.split(":")[0].trim()] = e
                                .split(":")[1]
                                .trim();
                    });
            } else beatmap[key] = data[key];
        });
        var currentCode = "osu file format v14";
        currentCode += ";;[General]";
        keys["[General]"].forEach((e) => {
            if (beatmap["[General]"][e] != "")
                currentCode += `;${e}:${beatmap["[General]"][e]}`;
        });
        currentCode += ";;[Editor]";
        keys["[Editor]"].forEach((e) => {
            if (beatmap["[Editor]"][e] != "")
                currentCode += `;${e}:${beatmap["[Editor]"][e]}`;
        });
        currentCode += ";;[Metadata]";
        keys["[Metadata]"].forEach((e) => {
            if (beatmap["[Metadata]"][e] != "")
                currentCode += `;${e}:${beatmap["[Metadata]"][e]}`;
        });
        currentCode += ";;[Difficulty]";
        var Difficulty = [];
        keys["[Difficulty]"].forEach((e) => {
            if (beatmap["[Difficulty]"][e] != "") {
                Difficulty.push(beatmap["[Difficulty]"][e]);
                currentCode += `;${e}:${beatmap["[Difficulty]"][e]}`;
            }
        });
        currentCode += ";;[Events]";
        beatmap["[Events]"].forEach((e) => {
            if (e != "") currentCode += ";" + e;
        });
        currentCode += ";;[TimingPoints]";
        beatmap["[TimingPoints]"].forEach((e) => {
            if (e != "") currentCode += ";" + e;
        });
        currentCode += ";;;[Colours]";
        keys["[Colours]"].forEach((e) => {
            if (beatmap["[Colours]"][e] != "")
                currentCode += `;${e}:${beatmap["[Colours]"][e]}`;
        });
        currentCode += ";;[HitObjects]";
        beatmap["[HitObjects]"].forEach((e) => {
            if (e != "") currentCode += ";" + e;
        });
        currentCode += ";";
        return currentCode;
    }

