    function cropImageToStage(img) {
        const s = Math.max(480 / img.width, 360 / img.height);
        ctx.drawImage(
            img,
            0,
            0,
            img.width,
            img.height,
            (480 - img.width * s) / 2,
            (360 - img.height * s) / 2,
            img.width * s,
            img.height * s,
        );
        return canvas.toDataURL();
    }
